function postulate(n){$.ajax({url:"Postulate",type:"GET",dataType:"json",data:{request:n},success:function(n){n.status?toastr.success(n.message):toastr.warning(n.message)},error:function(){toastr.error("Une erreur a été rencontrée. Veuillez réessayer s'il vous plaît!")}})}$(document).ready(function(){$(".request").on("click",function(n){n.preventDefault();let t=this.getAttribute("request");postulate(t)})});